class Solution:
    def fourSum(self, nums, target):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """
        ans = []
        nums.sort()
        nums_length = len(nums)
        if nums_length < 4:
            return ans
        prev_i = float("inf")
        for i in range(0, nums_length-3):
            if nums[i] == prev_i:
                continue
            prev_j = float("inf")
            for j in range(i+1, nums_length-2):
                x = j+1
                y = nums_length-1
                if nums[j] == prev_j:
                    continue
                while x<y:
                    sum4 = nums[i] + nums[j] + nums[x] + nums[y]
                    if sum4 == target:
                        ans.append((nums[i], nums[j], nums[x], nums[y]))
                        x+=1
                        y-=1
                    elif sum4 > target:
                        y-=1
                    elif sum4 < target:
                        x+=1
                prev_j = nums[j]
            prev_i = nums[i]
        return list(map(lambda x: [x[0], x[1], x[2], x[3]], set(ans)))




